DROP DATABASE IF EXISTS webstoredb;
CREATE DATABASE webstoredb;
CREATE TABLE webstoredb.attribute (id int NOT NULL AUTO_INCREMENT, attribute_group_id int NOT NULL, name varchar(255) NOT NULL, PRIMARY KEY (id)) ENGINE=InnoDB DEFAULT CHARSET=latin1 DEFAULT COLLATE=latin1_swedish_ci;
