INSERT INTO webstoredb.checkout_order_item (id, order_id, created_at, updated_at, product_id, attribute_id, store_id, parent_id, is_virtual, sku, name, description, free_shipping, weight, quantity, price, base_price, row_total, base_row_total, row_weight, product_type) VALUES (351, 346, '2018-10-06 09:52:23', '2018-10-06 09:52:23', 2, 0, 0, 304, 0, 'Train_to_Pakistan', 'Train to Pakistan', 'Set in the summer of 1947, Khushwant Singh could never have been so straight from his heart than he was in this book, Train to Pakistan. A love story set in the village of Mano Majra, situated on the border between India and Pakistan, the novel has successfully portrayed the days of partition - the strife, the grievances, the loss, the struggles, the emotional turmoil. As the story progresses, it becomes very hard to accept the fact that both Muslims and Hindus were to blame. Starkly Khushwant Singh explains the blood shedding and sufferings of children and women, it brings a shiver to your body.', 0, 0.0000, 1.0000, 147.0000, 147.0000, 147.0000, 147.0000, 10.0000, null);
