INSERT INTO webstoredb.checkout_quote_item (id, quote_id, created_at, updated_at, product_id, attribute_id, store_id, parent_id, is_virtual, sku, name, description, free_shipping, weight, quantity, price, base_price, row_total, base_row_total, row_weight, product_type) VALUES (359, 313, '2018-11-01 12:25:26', '2018-11-01 12:25:26', 1, 0, 0, 0, 0, 'Life_is_What_You_Make_it', 'Life is What You Make it', 'Ankita Sharma has the world in her palms. She is young, smart and heads turn at every corner she walks by. Born into a conservative middle class household - this defines the chronicle of her life. Set in a time when Doordarshan was the prime source of entertainment and writing love letters was the general fad, every youngster dreams of the thrills of college life. And so, her admission into an MBA institute in Mumbai follows. Ankita''s story begins here, from her life as a college student. Life seems all sunshine and flowers until a drastic turn leaves her staring at a disturbing path, only because of her own misdoing. Jump to six months later', 0, 10.0000, 1.0000, 51.0000, 51.0000, 51.0000, 51.0000, 10.0000, null);
