INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (20, 2, 1, 'enUS', 'Train to Pakistan');
INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (21, 2, 2, 'enUS', 'Set in the summer of 1947, Khushwant Singh could never have been so straight from his heart than he was in this book, Train to Pakistan. A love story set in the village of Mano Majra, situated on the border between India and Pakistan, the novel has successfully portrayed the days of partition - the strife, the grievances, the loss, the struggles, the emotional turmoil. As the story progresses, it becomes very hard to accept the fact that both Muslims and Hindus were to blame. Starkly Khushwant Singh explains the blood shedding and sufferings of children and women, it brings a shiver to your body.');
