INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (39, 3, 1, 'enUS', 'Mango Chutney: An Anthology of Tasteful Short Fiction');
INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (40, 3, 2, 'enUS', 'In the sleepy rural town of Bikramganj, a halwai named Lachhuman recieves a letter from an unseen Lakshmi. A thousand kilometres away in Delhi, a woman waits an eternity for her birth certificate. In the sweltering heat of Chennai, a girl finds solace in her grandfather''s shirt. The stakes are high on the Euro rail on its way to Budapest where two Austrians try to trick an Indian woman at a card game. Back home in Vizag, an egg is being poarched to perfection. Mango Chutney, true to its name, is potpourri of quality short-fiction by some of India''s finest writers. Compiled and edited by bestselling author, Harsh Snehanshu, these stories, with just the right amount of sugar and tang, shall provoke, tickle and above all, linger your mind.');
