INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (59, 4, 2, 'enUS', 'Ever since Robinson Crusoe in 1719, the novel has introduced British readers to truly unforgettable characters - people in whom we can find deeper understanding of our own lives. In this engaging and personal book, Sebastian Faulks examines and celebrates the most famous and best-loved of these dazzling fictional creations and their wider impact on British culture as a whole. From Sherlock Holmes and Mr Darcy to Emma Woodhouse and James Bond - this is the story of the heroes, lovers, snobs and villains in all of us.');
