INSERT INTO webstoredb.product_entity_values (id, product_id, attribute_id, language, value) VALUES (116, 7, 2, 'enUS', 'If you''re looking for an intelligent smartphone that gives you a processing experience like never before, you can go for the Micromax Canvas Power A96. At the heart of this phone lies the 1.3GHz MTK 6582M Quad Core processor that gives you lightning fast speed for your videos and gaming applications. Added to that is the 512MB RAM that allows you to run many high-end applications at once without any lag or slowdown. So, if you love videos and gaming, the Micromax A96 can be an ideal choice for you.');
